import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
const Projets = () => {
  return (
    <div>
      <div className="typewriter-container">
        <div className="typewriter">
          <h1 className="text-center text-warning text-decoration-underline">Mes Projets</h1>
        </div>
      </div>
      <Row>
        <Col sm={6}>
          <p>Projet uno</p>
        </Col>
        <Col sm={6}>
          <div className="ImgPro">
            <img
              className="img-fluid"
              src="./img/pp_site.png"
              alt="projet 1"
            ></img>
          </div>
        </Col>
      </Row>
    </div>
  );
};

export default Projets;
